&quot;Family Fantasy&quot; confronts the delicate subject of sex between unrelated members within an upscale family. The father (portrayed by Joey Silvera) has married a beautiful young woman (Yvonne) and brought his adopted daughter (Danyel Cheeks) to live with them. Yvonne's daughter is Jasper (playing herself). This precocious and deceptively seductive young girl seems determined to seduce her stepfather. Danyel, who is painfully aware of Jasper's manipulations, resents the time the man she thinks is her Daddy spends with his stepdaughter. She is determined to win back his attention. This sets the stage for a compelling look into the hidden and dark urges that drive many of us to sex.

